  \"2016-11-25T21:06:33.297473\",\n\t\"name\": \"2003-program-for-international-student-assessment\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Program for International Student Assessment,
  2003 (PISA:03), is a study that is part of the Program for International Student
  Assessment (PISA) program. PISA:03 (http://nces.ed.gov/surveys/pisa/) is a cross-sectional
  study that measures the yield of education systems, or what skills and competencies
  students have acquired and can apply in reading, mathematics, and science to real-world
  contexts by age 15. For PISA:03, mathematics literacy was the subject area assessed
  in-depth. The study was conducted using questionnaires and direct assessments of
  15-year-old students. 15-year-old students in April to May of 2003 were sampled.
  The studyufffds response rate was 83 percent. Key statistics produced from PISA:03
  are 15-year-olds' capabilities in reading, mathematics, and science literacy.\",\n\t\"license_title\":
